import React from 'react'

function Addcart() {
  return (
    <>
     <div>
      <h2>Shopping Cart</h2>
      {cart.map((item) => (
        <div key={item._id}>
          <p>Book Name: {item.bookname}</p>
          <p>Author: {item.author}</p>
          <p>Price: {item.price}</p>
         
        </div>
      ))}
    </div>
    </>
  )
}

export default Addcart
